1578;1578;43rES;Przedstawiam piękny apartament w prestiżowej lokalizacji na warszawskim Powiślu. Lokalizacja:Mieszkanie znajduje się w inwestycji przy ulicy Wybrzeże Kościuszkowskie 45. Naprzeciwko Centrum Nauki Kopernik oraz nowo wybudowanych bulwarów wiślanych. W pobliżu stacja drugiej linii metra oraz przystanki autobusowe. Odległość do centrum miasta to zaledwie kilka minut zarówno samochodem jak i komunikacją miejską. W pobliżu restauracje i sklepy. Jest to spokojna część miasta, a zarazem w pobliżu ciekawych i popularnych miejsc na spędzanie czasu w ciągu dnia i wieczorami. *Apartament: Jego powierzchnia to 65,55 m2. Znajduję się w nim salon, połączony z aneksem kuchennym. Jest on wyposażony w duży TV, piękną drewnianą podłogę, duże okna balkonowe wzdłuż całego salonu, grzejniki podłogowe, kanapę, fotel, duży stół i krzesła. Jest on oddzielony szklaną ścianką od kuchni. Kuchnia również jest w pełni wyposażona. Oprócz wszystkich niezbędnych sprzętów AGD znajduje się tam między innymi ekspres do kawy. W korytarzu prowadzącym do łazienki i sypialni znajdują się dwa kilkumetrowe pomieszczenia. Jedno wykorzystane zostało jako pomieszczenie gospodarcze, a drugie jako garderoba.  Łazienka jest wyposażona w kabinę prysznicową, dużą umywalkę, lustro oraz WC. W sypialni również znajdziemy wyjście na taras, oprócz tego duże podwójne łóżko, duży kompleks szaf w zabudowie na dwóch ścianach oraz TV.  W mieszkaniu zastosowano szereg nowoczesnych rozwiązań użytkowych jak m.in zasłony i kotary sterowane elektrycznie za pomocą pilota, klimatyzację w każdym z pomieszczeń sterowaną centralnie. Wokół telewizora znajdują się dyskretnie ukryte szafki oraz kolumny głośnikowe kina domowego. Pozostała część głośników zamontowana została w suficie. 1 500 000 zł + 120 000 zł miejsce parkingowe. Czynsz administracyjny ok 650 złZapraszam do kontaktu, celem umówienia się na obejrzenie mieszkania. ;;;;1.0;1.0;1.0;1.0;;5.0;2;3;65,55 m²;;wtórny;700 zł;;pełna własność;;miejskie;drewniane;2017.0;do zamieszkania;;;;;1.0;1.0;;;;;;;;;;;;;
1601;1601;44gu5;Zachęcamy do zapoznania się z aktualną ofertą na naszej stronie Home4Nowoczesny budynek zlokalizowany w jednej z najlepiej rozwijających się części Białołęki - Żerań. Powstają tu atrakcyjne osiedla, punkty usługowe, restauracje, sklepy i centra handlowe, a liczne tereny zielone przyjmują charakter sprzyjający aktywnemu wypoczynkowi. Lokalizacja inwestycji pozwala w kwadrans dotrzeć do Metra Marymont, a samochodem do Centrum 20 minut.W inwestycji zaprojektowano 75 mieszkań w metrażach od 29 do 89. Są to przede wszystkim mieszkania 2pokojowe, a także 3 i 4- pokojowe. Wszystkie zaprojektowane zostały w sposób ułatwiający funkcjonalną aranżację wnętrz. Niewątpliwym atutem są duże okna, częściowo o narożnym układzie, co pozwala na doskonałe doświetlenie wnętrz. Do lokali na parterze przynależą ogródki w których można zaplanować indywidualną aranżację zieleni. W ofercie sprzedaży znalazło się 86 miejsc parkingowych w jednopoziomowym garażu podziemnym.;;;;;;;;;5.0;3;5;43,15 m²;;pierwotny;;;;;;;2020.0;;;;;;;;;;;;;;;;;;;;
