2241;2241;44lVG;Klimatyczne 2 pokojowe mieszkanie w Starym Ursusie.Lokal w 2015 przeszedł kapitalny remont, składa się dwóch osobnych pokoi, osobnej widnej kuchni, łazienki z kabiną prysznicową i WC oraz przedpokoju.Do lokalu przypisana jest duża piwnica.Okna PCV wychodzą na trzy strony świata.Budynek z cegły z lat sześćdziesiątych.Okolica cicha i spokojna, blisko do parków i terenów rekreacyjnych. W pobliżu pełna niezbędna infrastruktura. Do stacji PKP Ursus 10 min spacerem. Blisko domu przystanki autuobusowe. Zapraszam do oglądania,Zbigniew ModrzewskiMokotiko Nieruchomości501074223;;1.0;;;;;;;3.0;2;parter;53 m²;blok;wtórny;470 zł;;;cegła;miejskie;plastikowe;1965.0;do zamieszkania;;;1.0;;;;;;1.0;;;;;;;;;;
2273;2273;438cF;LUKSUSOWY APARTAMENT W SAMYM CENTRUM WARSZAWY, O NIEPOWTARZALNYM WYSTROJU I WYJĄTKOWYM KLIMACIE220m2 | 5 sypialni | taras | unikalny design | widok na panoramę miasta *****GŁOWNE ATUTY: Oferowany apartament to propozycja nietuzinkowa i absolutnie wyjątkowa. Jego wystrój inspirowany jest orientem, możemy w nim znaleźć liczne elementy architektoniczne rodem z Dalekiego Wschodu, jak choćby przepiękne drzwi w salonie, rzeźbione w drewnie egzotycznym. Apartament wykończony został w najwyższym standardzie, z użyciem materiałów światowej klasy. Na uwagę zasługuje duża i wygodna, oddzielna kuchnia - stylowo wykończona, z podłogą ze szlachetnego kamienia i ogrzewaniem podłogowym. Z tarasu roztacza się wspaniały widok na Plac Grzybowski i panoramę Warszawy, z Pałacem Kultury i śródmiejskimi wieżowcami w tle.Połączenie komfortu i wygodnego rozkładu z pierwszorzędną lokalizacją oferuje mieszkańcom apartamentu miejskie życie na najwyższym poziomie. ROZKŁAD POMIESZCZEŃ: Apartament posiada łącznie 6 pokoi: przestronny salon z wyjściem na taras, kuchnię, 5 sypialni, 3 łazienki oraz oddzielną garderobę.LOKALIZACJA:Ulica Grzybowska położona jest w samym sercu Warszawy. Pieszy dystans do wszystkich środków komunikacji miejskiej, w tym stacji przesiadkowej metra M1/M2 Świetokrzyska. Centralna lokalizacja wraz z doskonałą infrastrukturą handlowo - usługową dają duży komfort mieszkania, tuż obok znajdują się takie punkty usługowe jak: apteka, sklepy spożywcze, salon fryzjersko- kosmetyczny, banki. W pobliżu także: kina, teatry, Ogród Saski, sklepy, piekarnie, kawiarnie, biurowce, pięciogwiazdkowe hotele. Dwa kroki do Dworca Centralnego i CH Złote Tarasy.INFORMACJE DODATKOWE:Do apartamentu przynależą 2 miejsca parkingowe w garażu podziemnym (poziom -1), zawarte w cenie.——————————————KONTAKT:Andrzej Herzog: +48 730 606 001 (licencja zawodowa nr 24635)Pośrednik odpowiedzialny: Joanna Czapska (licencja zawodowa nr 4585)Przedstawiona wyżej oferta nie jest ofertą handlową w rozumieniu przepisów prawa, lecz ma charakter informacyjny. Partners International dokłada starań, aby treści przedstawione w naszych ofertach były aktualne i rzetelne. Dane dotyczące ofert uzyskano na podstawie oświadczeń sprzedających.Jako agencja nieruchomości pobieramy wynagrodzenie w formie prowizji. ——————————————CONTACT:Andrzej Herzog: +48 730 606 001 (professional license No. 24635)Broker responsible: Joanna Czapska (professional license No. 4585)The above information is not a commercial offer for the purposes of the law but is informative. All data relating to real estate was obtained on the basis of statements of the Sellers.As a real estate agency we charge a comission. ——————————————A LUXURY APARTMENT IN THE SAME CENTER OF WARSAW, ABOUT EXTREMELY STANDARD AND EXCEPTIONAL CLIMATE220m2 | 5 bedrooms | Terrace | Unique design | View of the city skyline*****MAIN ADVANTAGES:The offered apartment is an unusual and absolutely unique proposition. Its decor is inspired by the Orient, we can find there numerous archotectonic elements from the Far East, such as the beautiful door in the living room, carved in exotic wood.The apartment has been finished to the highest standard, using world-class materials. Noteworthy is the large and comfortable, separate kitchen - stylishly finished, with a floor of precious stone and underfloor heating.The terrace offers a magnificent view of Grzybowski Square and the Warsaw panorama, with the Palace of Culture and downtown skyscrapers in the background.The combination of comfort and convenient distribution with a first-class location offers the apartment's inhabitants urban living at the highest level.DISTRIBUTION OF ROOMS:The apartment has a total of 6 rooms: a spacious living room with a terrace exit, kitchen, 5 bedrooms, 3 bathrooms and a separate walk-in closet.LOCATION:Grzybowska Street is located in the very heart of Warsaw. Pedestrian distance to all means of public transport, including the M1 / ​​M2 metro interchange station Świetokrzyska. The central location, along with excellent commercial and service infrastructure is a source of great comfort.  Next to the building there are such service points as: pharmacy, grocery stores, hairdresser and cosmetics salon, banks. Also nearby: cinemas, theaters, Saxon Garden, shops, bakeries, cafes, office buildings, five-star hotels. Short walk takes us to the Central Railway Station and Złote Tarasy shopping center.ADDITIONAL INFORMATION: The apartment has 2 parking spaces in the underground garage (level -1), included in the price.;;1.0;;;;;;1.0;11.0;6;6;220 m²;apartamentowiec;wtórny;;;pełna własność;;miejskie;;2002.0;;;;;1.0;1.0;1.0;;;;;;;;;;;;;
