5403;5403;43Sja;Ciche, rozkładowe, trzypokojowe, gustownie urządzone mieszkanie ,w pięknej części Wilanowa-Zawady.Apartament usytuowany jest na nowym, kameralnym osiedlu, w zielonej części Wilanowa przy ul. Bruzdowej. Mieści się na pierwszym piętrze dwupiętrowego budynku.Całą okolicę cechuje niska zabudowa domów jednorodzinnych i apartamentowców, bardzo dużo miejsc do spacerów, wycieczek rowerowych oraz aktywnego spędzania czasu.Istniejąca infrastruktura daje możliwość swobodnego dostania się do każdej dzielnicy Warszawy. Obwodnica w Wilanowie zapewni niedługo jeszcze lepszą płynność komunikacyjną.W okolicy jest wiele przedszkoli, szkół, restauracji i sklepów. Apartament ma bardzo funkcjonalny rozkład, duży balkon z widokiem na wewnętrzne patio. Wszystkie okna i balkon wychodzą na południe i zielone patio. Są tutaj 2 sypialnie, duży salon połączony z aneksem kuchennym, przestronny hol, duża łazienka z wanną i prysznicem. Do mieszkania przynależy piwnica wliczona w cenę mieszkania i dwa miejsca parkingowe w garażu dodatkowo płatne. Jest możliwość kupienia tylko jednego miejsca.Mieszkanie jest jasne, ma drewniane podłogi i piękne, klimatyczne  meble robione na zamówienie.Kontakt: Joanna Gajewska tel. 698 908 313::DODATKOWE INFORMACJE Rodzaj budynku: apartamentowiecGłośność: cicheWidok: na osiedleWoda: ciepła - miejskaOtoczenie: osiedleOgrzewanie: C.O. miejskieKomunikacja publ.: autobus miejskiWinda: NIERozkład: rozkładoweUsytuowanie: jednostronneRodzaj mieszkania: jednopoziomoweGaraż: garaż pod budynkiemStan lokalu: bardzo dobryOkna: drewnianeBalkon: jestLiczba balkonów: 1Powierzchnia użytkowa [m2]: 72Rok budowy: 2004Liczba pokoi: 3Liczba sypialni: 2Powierzchnia pokoi [m2]: 36  10,5  8Podłogi pokoi: drewnianaWystawa okien - pokoje : PdRodzaj kuchni: aneks kuchenny połączony z jadalnią i salonemTyp łazienki: razem z wcLiczba łazienek: 1Powierzchnia łazienki [m2]: 7Podłoga łazienki: gresWyposażenie łazienki: prysznic, umywalka, wanna, WCLiczba przedpokoi: 2Powierzchnia 