6625;6625;43Boq;| Przedmiotem mojej aukcji jest 3 pokojowe mieszkanie o metrażu 47 m2 z  balkonem. Warszawa dzielnica Wola, 3 piętro.W bloku są dwie windy i duża klatka schodowa . Kuchnia jasna z oknem i szafkami kuchennymi .Łazienka razem z toaletą .Podwójne drzwi wejściowe do mieszkania.Domofon.Podłoga parkiet dębowy we wszystkich pokojach wraz z przedpokojem.W przedpokoju szafa z przesuwnymi drzwiami .W każdym pomieszczeniu są nowe parapety z jasnego marmuru .Stolarka okienna niedawno po wymianie , wszystkie okna łącznie z balkonowym.Grzejniki wymienione na nowe 2 lata temu.Dodatkowo do mieszkania przypisana jest piwnica .W przypadku pytań zapraszam do kontaktu.::DODATKOWE INFORMACJE | Rodzaj budynku: blok | Woda: ciepła - miejska | Ogrzewanie: miejskie | Winda: TAK | Liczba wind: 2 | Rozkład: jednostronne rozkładowe | Usytuowanie: jednostronne | Rodzaj mieszkania: jednopoziomowe | Piwnica: TAK | Stan lokalu: Do wprowadzenia | Okna: PCV | Balkon: jest | Liczba balkonów: 1 | Powierzchnia użytkowa [m2]: 47 | Rok budowy: 1969 | Liczba pokoi: 3 | ::LINK DO STRONY | ::KONTAKT DO AGENTA | Damian Wójcik | +48 516 368 728 | ::DANE BIURA | Aspect Nieruchomości - Warszawa Centrum | RESTA-ESTATE Sp z o.o. | Żurawia 6/12/745 | 00-503 Warszawa | +48 516 368 728 | -pozostałe oferty na wszystkie oddziały dostępne na  |  Mieszko.my;1.0;;;;;;;;8.0;3;3;47 m²;blok;wtórny;;;;;miejskie;plastikowe;1969.0;do zamieszkania;;;1.0;;1.0;;;;;;;;;;;;;;
6634;6634;3VNAY;Nieruchomość położona jest na  granicy Ochoty i Włoch.Główne atuty nieruchomości: • doskonała komunikacja z centrum• cicha i spokojna okolica• ogródekNieruchomość złożona z: • salon 35,38 m.kw• kuchnia otwarta z oknem 9,31 m.kw• sypialnia 14,06 m.kw• sypialnia 12,93 m.kw• sypialnia 12,08 m.kw• garderoba 3,02 m.kw• łazienka 4,95 m.kw• wc 3,37 m.kw• komunikacja 22,2 m.kw W skład nieruchomości wchodzą też:• miejsce parkingowe• ogródekTyp ogrzewania: ogrzewanie na gaz miejski. Typ własności: własność. Mieszkanie w stanie  deweloperskim, o pow. 117,30 mkw i ogródkiem 165mkw, składa się z salonu, otwartej kuchni z oknem, trzech sypialni, garderoby, łazienki, WC i korytarza. Mieszkanie usytuowane jest na parterze, dwupiętrowego, kameralnego Apartamentowca z windą. Okolica cicha i spokojna. Bardzo dobra komunikacja miejska. W pobliżu pełna infrastruktura, szkoły, przedszkola, sklepy. Do mieszkania przynależą 2 miejsce postojowe w garażu podziemnym dodatkowo płatne  po 30 000 zł każde oraz komórka lokatorska dodatkowo płatna 16 000zł.  Polecam !ZADZWOŃ: 668 862 832. Czekamy na telefon od Ciebie. ---Zakup lub najem nieruchomości przez Agencję Metrohouse to:• największy wybór na rynku• elastyczne podejście do Klienta• bezpieczeństwo transakcji• możliwość skorzystania z szerokiej oferty kredytów gotówkowych i hipotecznych• doświadczeni doradcyPomimo, iż Doradcy Metrohouse przykładają szczególną staranność do rzetelnego prezentowania informacji o nieruchomości, nie zawsze jest możliwa weryfikacja wszystkich danych przekazanych od osób trzecich. Niniejsza prezentacja oferty nie jest ofertą w rozumieniu Kodeksu Cywilnego i ma charakter wyłącznie informacyjny.;;;;;;;;;1.0;4;parter;117,30 m²;apartamentowiec;wtórny;;;;pustak;gazowe;;2017.0;do wykończenia;;1.0;;;1.0;;;;1.0;;;;;;;;;;
